webpackJsonp([0x87d376f9b505],{6831:function(e,t){e.exports={data:{post:{html:'<p>So, having jumped through all the hoops at the specialist and family doctor this morning, I\'m now sure that I didn\'t do any permanent damage to my <a title="Questions and Answers About Knee Problems" href="http://www.niams.nih.gov/hi/topics/kneeprobs/kneeqa.htm">knee</a> yesterday. I probably stretched a ligament in the knee capsule, which is now inflamed. The pain will subside with rest and ice, although last evening I also found Beck\'s Gold to be an effective pain killer.</p>',fields:{title:"Nothing Broken, Nothing Torn",date:"26 May 2004",url:"https://papascott.de/2004-05-26-nothing-broken-nothing-torn/"}}},pathContext:{slug:"/2004-05-26-nothing-broken-nothing-torn/",prev:{fields:{title:"Ja, Nico, mache ich schon",date:"26 May 2004",slug:"/2004-05-26-ja-nico-mache-ich-schon/"}},next:{fields:{title:"Health Insurance",date:"27 May 2004",slug:"/2004-05-27-health-insurance/"}}}}}});
